import React from "react";
import '../assets/css/Raw.css';


const Raw = () => {
    let join = "Join Space ";
    return (
        <div class="row" className="max_contai" className="border">
            <div class="col">
                <h2 className="join">{join}
                    <span className="name_tribe">Holberton ðŸ“š ðŸ¦ˆ</span>
                </h2>
            <p className="paragraph_signup">No signup or downloads needed</p>
            </div>
            <div class="col">2</div>
            <div class="col">
                <section className="paragraph_permision">
                    <p className="text_permision">Tribe needs your permission to access the camera and microphone.</p>
                    <button type="button" class="btn btn-primary">Primary</button>
                </section>
            </div>
            <div class="col">
            <button type="button" class="btn btn-primary btn-lg btn-block">Block level button</button>
            </div>
        </div>
    );
};

export default Raw;
